import React, { useState, useEffect } from 'react';
import axios from 'axios';
import styles from './TimesheetEntry.module.css';

function TimesheetEntry() {
  const [formData, setFormData] = useState({
    projectId: '',
    subprojectId: '',
    jiraId: '',
    taskDescription: '',
    hoursSpent: 0,
    comments: ''
  });
  const [projects, setProjects] = useState([]);
  const [subprojects, setSubprojects] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    fetchProjects();
  }, []);

  useEffect(() => {
    console.log('Projects state updated:', projects);
  }, [projects]);

  const fetchProjects = async () => {
    setIsLoading(true);
    try {
      const response = await axios.get('http://localhost:8080/projects');
      console.log('Raw API response:', JSON.stringify(response.data, null, 2));

      let projectsData = [];
      if (Array.isArray(response.data)) {
        projectsData = response.data;
      } else if (response.data && typeof response.data === 'object') {
        // If the response is an object, try to find an array in it
        const arrayProperty = Object.values(response.data).find(val => Array.isArray(val));
        if (arrayProperty) {
          projectsData = arrayProperty;
        }
      }

      if (projectsData.length > 0) {
        // Ensure each project has id and name properties
        const formattedProjects = projectsData.map(project => ({
          id: project.id || project.projectId || project._id,
          name: project.name || project.projectName || project.title
        }));
        setProjects(formattedProjects);
      } else {
        console.error('No projects found in the API response');
        setProjects([]);
      }
    } catch (error) {
      console.error('Error fetching projects:', error);
      setProjects([]);
    } finally {
      setIsLoading(false);
    }
  };
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });

    if (name === 'projectId') {
      const selectedProject = projects.find(p => p.id === value);
      setSubprojects(selectedProject ? selectedProject.subprojects : []);
    }
  };

  const handleHoursChange = (increment) => {
    setFormData(prev => ({
      ...prev,
      hoursSpent: Math.max(0, prev.hoursSpent + increment)
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:8080/timesheet', formData);
      alert('Timesheet entry submitted successfully!');
      // Reset form or redirect as needed
    } catch (error) {
      console.error('Error submitting timesheet:', error);
      alert('Failed to submit timesheet entry. Please try again.');
    }
  };

  console.log('Current projects state:', projects);

  return (
    <div className={styles.container}>
      <h2>Timesheet Entry</h2>
      <form onSubmit={handleSubmit} className={styles.form}>
        <div className={styles.formGroup}>
          <label htmlFor="projectId">Project ID:</label>
          {isLoading ? (
            <p>Loading projects...</p>
          ) : projects.length > 0 ? (
            <select
              id="projectId"
              name="projectId"
              value={formData.projectId}
              onChange={handleInputChange}
              required
            >
              <option value="">Select a project</option>
              {projects.map(project => (
                <option key={project.id} value={project.id}>{project.name}</option>
              ))}
            </select>
          ) : (
            <p>No projects available</p>
          )}
        </div>

        <div className={styles.formGroup}>
          <label htmlFor="subprojectId">Subproject ID:</label>
          <select
            id="subprojectId"
            name="subprojectId"
            value={formData.subprojectId}
            onChange={handleInputChange}
            required
          >
            <option value="">Select a subproject</option>
            {subprojects.map(subproject => (
              <option key={subproject.id} value={subproject.id}>{subproject.name}</option>
            ))}
          </select>
        </div>

        <div className={styles.formGroup}>
          <label htmlFor="jiraId">Jira ID:</label>
          <input
            type="text"
            id="jiraId"
            name="jiraId"
            value={formData.jiraId}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className={styles.formGroup}>
          <label htmlFor="taskDescription">Task Description:</label>
          <textarea
            id="taskDescription"
            name="taskDescription"
            value={formData.taskDescription}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className={styles.formGroup}>
          <label htmlFor="hoursSpent">Hours Spent:</label>
          <div className={styles.hoursInput}>
            <button type="button" onClick={() => handleHoursChange(-0.5)}>-</button>
            <input
              type="number"
              id="hoursSpent"
              name="hoursSpent"
              value={formData.hoursSpent}
              onChange={handleInputChange}
              step="0.5"
              min="0"
              required
            />
            <button type="button" onClick={() => handleHoursChange(0.5)}>+</button>
          </div>
        </div>

        <div className={styles.formGroup}>
          <label htmlFor="comments">Comments:</label>
          <textarea
            id="comments"
            name="comments"
            value={formData.comments}
            onChange={handleInputChange}
          />
        </div>

        <button type="submit" className={styles.submitButton}>Submit</button>
      </form>
    </div>
  );
}

export default TimesheetEntry;
